INSERT INTO `posts` VALUES (1,3,'La violencia en el fútbol suele ser moneda corriente y el desvelo de muchos que desean erradicarla de una vez por todas. El clima de extrema competitividad que generalmente se genera, es donde muchos entrenadores, padres o familiares, viven con pasión desmedida el desarrollo de los partidos. En este caso, debemos serenarnos y trasmitirles a los niños que solo deben considerar al otro equipo como un rival dentro del campo de juego y concentrar nuestros esfuerzos en un futuro mejor para nuestros hijos. Desde nuestra Asociación, levantamos la bandera de la importancia de un tercer tiempo, en donde todos los chicos puedan compartir y sepan que un espectáculo deportivo, es un canal de expresión en donde podemos competir y anhelar ganar los partidos, pero deseando aún con mayor fervor una sociedad más justa y en paz.','Rivales deportivos, no enemigos',NULL,'2019-05-09 03:00:00','2019-06-08 14:23:01'),(2,3,'El 15 y 16 de septiembre del año pasado, se llevó a cabo en las instalaciones de F5, el 1º Torneo Regional de Baby Fútbol (categoría 2006) denominado \"Franco Mayorga\". Este importante certamen deportivo, contó con la participación de 20 equipos, no solo de la ciudad capital, sino también del interior de nuestra provincia. Cabe destacar, que fueron premiados con una medalla cada uno de los niños participantes, y claro está, también recibieron sus trofeos quienes se consagraron campeones tanto en la Copa de Oro, como la Copa de Plata, y los conjuntos que terminaron en 2º, 3º y 4º puesto. Sin lugar a dudas, fue un evento de gran magnitud, que colmó ampliamente las expectativas de los jugadores, entrenadores, publico en general, y los organizadores, la Asociación Riojana de Baby Fútbol Infantil.','1º Regional de Baby Fútbol',NULL,'2019-05-09 03:00:00','2019-06-08 14:24:01'),(3,3,'Hace más de 8 años, Nicolás Peralta, presidente de A.R.B.F.I, comenzaba a dar los primeros pasos con está asociación para convertirse así en el pionero del Baby Fútbol en La Rioja. Desde esa época y hasta la actualidad, trabaja incansablemente y con el mismo entusiasmo de siempre. Hace malabares para repartir su tiempo entre su familia, el trabajo y esta tarea que tanto lo apasiona, el fútbol infantil. Luego de una vasta trayectoria no solo como jugador en inferiores sino también como instructor de fútbol en el partido de 3 de Febrero (Bs. As.), destacó con emoción que “cuando retorne a mi provincia, decidí continuar con mi pasión por este deporte, con el apoyo de mi familia y de mis hijos Ezequiel y Agustín, y este último fue la razón que me llevó a fundar esta fantástica liga en el 2011 y dar así el puntapié inicial”. Así que “Nico”, tal como la mayoría lo conoce, desde nuestra lugar queremos felicitarte y a seguir adelante con más fuerzas que nunca.','El pionero del Baby Fútbol',NULL,'2019-05-09 03:00:00','2019-06-08 14:24:50'),(4,3,'Cuando comienza a rodar una pelota por el campo de juego, detrás de ella se agolpan miles de ilusiones. En La Rioja, con el correr de los años, se han multiplicado las escuelitas de fútbol, con el afán de brindarle a tantos niños un lugar de contención y recreación. Además de entrenar, se transmiten valores como la constancia, el sacrificio, la disciplina, el espíritu de superación, el compañerismo, la solidaridad, entre tantas otras cosas. Así mismo, no es ninguna novedad que en los clubes que participan del Baby fútbol, los entrenadores, delegados y padres reparten su tiempo entre sus actividades privadas y la colaboración a la institución donde sus pequeños hijos juegan, aprenden, y comparten. Por tal motivo, debemos dar el ejemplo de que el fútbol es un juego, en donde los niños puedan lograr vencer la presión y trabajar en equipo, en donde aprendan que los rivales son compañeros con quienes jugar y que lo mas importante es divertirse y no tan solo ganar.','El fútbol también educa y forma niños',NULL,'2019-05-09 03:00:00','2019-06-08 14:25:33'),(5,1,'El próximo fin de semana se pondrá en marcha el segundo \"Torneo Regional\" con la participación de delegaciones de nuestra ciudad que participan actualmente en nuestro formato y equipos invitados.\r\nEl sábado a partir de las 9:00 hrs en las instalaciones de F5 Evolushon y hasta las 15 hrs Baby Futbol La Rioja se pone en movimiento con el torneo homenaje a \"Franco Mayorga\", \r\nCopa de Oro 1ro al 4to\r\nCopa de Plata 1ro al 4to\r\nparticipación para todos los jugadores.','Regional 2019',66,'2019-11-04 22:58:42','2019-11-04 22:58:42');
